import Header from "./component/Header";
import NavBar from "./component/NavBar";
import { Items } from "./Data";

const App=()=> {

  const [itemdata, setitemdata] = useState(Items)
  return (
    <div className="color-body font">
      <NavBar/>
      <Container>
        <Header/>
        <Categore/>
        <CardList itemdata={itemdata}/>
      </Container>
    </div>
  );
}

export default App;
